// Update Payload by Adding Dynamic Values to Some Fields
import groovy.json.*

def orgRefId = context.expand( '${#Project#OrgRefId2}' )

// Get Payload from Previous Test Case
def response = context.expand( '${#[TestSuite 1#StaffPeronsal-Multiple#PatchStaffPersonals]#Response}' )
def slurped = new JsonSlurper().parseText(response)

// Prepare New Payload
def newSlurped = new JsonSlurper().parseText('{"StaffAssignments": {"StaffAssignment": []}}')

// Get Total Count
def spCount = slurped.StaffPersonals.StaffPersonal.size()

// Loop Through and Update Fields for Each
for ( i = 0; i < spCount; i++)
{
	def staffRefId = slurped.StaffPersonals.StaffPersonal[i].StaffPersonalRefId
	def staffLocalId = slurped.StaffPersonals.StaffPersonal[i].StaffPersonalLocalId

	newSlurped.StaffAssignments.StaffAssignment <<
	[
		StaffAssignmentLocalId: "$staffLocalId" + "_" + "$orgRefId",
		StaffMember: [
			RefId: "$staffRefId"
		],
		AssignedLocation: [
			RefId: "$orgRefId"
		],
		StaffRole: "1002",
		StartDate: "1995-01-02T00:00:00+12:00"
	]	
}

// Set Values to Property
testRunner.testCase.testSteps["Properties 1"].setPropertyValue( "Count", spCount.toString() )
testRunner.testCase.testSteps["Properties 1"].setPropertyValue( "StaffAssignmentLocalId", newSlurped.StaffAssignments.StaffAssignment[0].StaffAssignmentLocalId )
testRunner.testCase.testSteps["Properties 1"].setPropertyValue( "StaffMemberRefId", newSlurped.StaffAssignments.StaffAssignment[0].StaffMember.RefId )
testRunner.testCase.testSteps["Properties 1"].setPropertyValue( "StaffRole", newSlurped.StaffAssignments.StaffAssignment[0].StaffRole )

// Write Updated Payload to Result
return new JsonBuilder(newSlurped)

